import {useReducer, useRef} from "react";
import TodoReducer, {initialState} from "../../../Reducer/TodoList";

const Add =({sendData})=>{
    const addinfo=useRef();
    function handdlesendData(){

        if(addinfo.current.value){
            sendData(addinfo.current.value)

            addinfo.current.value=''
        }
    }
    return(
        <>
            <div>
                <input type="text" ref={addinfo}/>
                <button onClick={handdlesendData}>Add</button>
                <img src="data:image/png;base64,
" alt=""/>
            </div>

        </>
    )
}

export  default  Add


